import React from 'react'
import logo from '../images/logo.png'

function Nav() {
  return (
    <div className='navbar'>
      <div className='leftSide'>
        <img src={logo} alt="logo"></img>
      </div>
      <div className='rightSide'></div>
      
    </div>
  );
}

export default Nav;
